import React from "react";
import Search from "../../Components/Search/Search";
import useStyles from "./styles";
import Grid from "@material-ui/core/Grid";
const Home = () => {
  const classes = useStyles();
  return (
    <Grid className={classes.body}>
      <Search />
    </Grid>
  );
};

export default Home;
